import React from 'react'
import '../assets/css/main.css'
import './assets/css/tailwind.css'

const MyApp = ({Component, pageProps}) =>{
    return (
    <div>
        <h1>My App</h1>
        <Component {...pageProps}/>
    </div>
    )
}

export default MyApp
